<p>iPhoneやスマートフォンの車載ホルダーが格安で登場<br>
  <br>当然、iPhone5も対応！<br>
  <br>ブラックとホワイトの2色から選択<br>
  <br>これさえあれば、車の中でもスマホが活用できる！<br>
</p>

スマホ車載ホルダーの特徴<br>●iPhoneやスマートフォンが取り付けたまま自由自在に回転できる。<br>
<br>●最大9cmまで開くクリップで色々なスマートフォンに対応します。<br>挟むだけの簡単クリップ式です。<br>
<br>●ワンタッチで固定できるレバー式です。吸盤の吸着力が弱まってきた際は、洗うことで吸着力が復活します。<br><table width="710" border="0" cellpadding="0" cellspacing="0">
